	(5, 'c62afa24-1582-4906-a87e-4539fdd2c71a', 'Tecnólogo en Gestión Contable y de Administración Financiera (Contabilidad)', '/contabilidad.jpg', 'Se dedica a la gestión de aspectos financieros y contables en empresas, garantizando la solidez económica y cumplimiento legal.', 1, '2023-11-07 11:46:42', NULL),
